import React, { useEffect } from "react";

function Column(props) {
  useEffect(props.calculateWinner);
  return (
    <button
      className="column"
      onClick={() => {
        props.handleColumnClick(props.id);
      }}
    >
      {renderSquares(props.arrInArr)}
    </button>
  );
}
export default Column;
